import React from 'react';
import { Link} from 'react-router-dom';


function Home() {
    return (
            <div>
                <h1>Добро пожаловать на сайт Пушистые Путешествия</h1>
                <Link to="/login">
                   <button> Вход </button>
                </Link>
                <Link to="/registration">
                    <button>Регистрация </button>
                </Link>
            </div>
    );
}

export default Home;
